    //     ...prevState,
    //     [name]: value,
    //   }
    // })
  }
  return (
    <form>
      <Input
        value={user}
        change={(e) => handleChange(e)}
        label="email"
        name="email"
      ></Input>
      <Input
        onChange={(e) => handleChange(e)}
        label="password"
        name="password"
      ></Input>
      <button></button>
    </form>
  )
}

export default Form
